DROP TABLE IF EXISTS L2BPoints CASCADE;

CREATE TABLE L2BPoints ( ptg SERIAL, ptgeom geometry, "osm_id" NUMERIC(11,0),"name" VARCHAR(48),"type" VARCHAR(16),CONSTRAINT "darpoints_pk" PRIMARY KEY (ptg) );

CREATE INDEX "darpoints_ptgeom_geom_idx" ON L2BPoints USING GIST ("ptgeom");


DROP TABLE IF EXISTS L2BBuildings CASCADE;

CREATE TABLE L2BBuildings ( ogcfid SERIAL,bdgeom geometry,"osm_id" NUMERIC(11,0),"name" VARCHAR(48),"type" VARCHAR(16), CONSTRAINT "darbuildings_pk" PRIMARY KEY (ogcfid) );
CREATE INDEX "darbuildings_bdgeom_geom_idx" ON L2BBuildings USING GIST ("bdgeom");

DROP TABLE IF EXISTS L2BRoads CASCADE;

CREATE TABLE L2BRoads (rdid SERIAL,rdgeom geometry,"osm_id" NUMERIC(11,0),"name" VARCHAR(48),"ref" VARCHAR(16),"type" VARCHAR(16), CONSTRAINT "darroads_pk" PRIMARY KEY (rdid) );

CREATE INDEX "darroads_rdgeom_geom_idx" ON L2BRoads USING GIST ("rdgeom");

